import './App.css';
import Login from './components/Login';
import {
 BrowserRouter,
 Routes,
 Route
} from 'react-router-dom';
import Navbar from "./components/Navbar";
import Signup from "./components/Signup";
function App() {

  return(
    <div>
    <BrowserRouter>
      <Navbar/>
      <Routes>
        <Route path="/" element={<Home/>}/>

      </Routes>


    </BrowserRouter>
    </div>
  )


}

export default App;
